import { BrowserRouter as Router, Route } from "react-router-dom";
import Home from "./components/Home";
import FormElement from "./components/Form";

function App() {
  return (
    <Router>
      <Switch>
        <Route path="/" element={<Home />} />
        <Route path="/form" element={<FormElement />} />
      </Switch>
    </Router>
  );
}

export default App;
